import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { CloudUpload } from '@mui/icons-material';
import { Box, Container, Typography, Button } from '@mui/material';
import '../styles/theme.css';

const Dashboard = () => {
  const [files] = useState([]);

  return (
    <Box sx={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '100vh', backgroundColor: '#f5f5f5' }}>
      <Container maxWidth="md">
        <Box sx={{ textAlign: 'center', padding: '3rem', backgroundColor: '#fff', borderRadius: '8px', boxShadow: 3 }}>
          <Typography variant="h4" component="h1" color="primary" sx={{ marginBottom: '2rem' }}>
            Welcome to Storify
          </Typography>
          <Typography variant="h6" component="h2" sx={{ marginBottom: '2rem' }}>
            {files.length === 0 
              ? "Upload, organize and access your files from anywhere." 
              : `You have ${files.length} file${files.length !== 1 ? 's' : ''} uploaded`}
          </Typography>
          <Link to="/upload" style={{ textDecoration: 'none' }}>
            <Button variant="contained" color="primary" startIcon={<CloudUpload />}>
              Start Uploading
            </Button>
          </Link>
          {files.length > 0 && (
            <Box sx={{ marginTop: '2rem' }}>
              {files.map(file => (
                <Box key={file.id} sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', padding: '0.5rem', borderBottom: '1px solid #ddd' }}>
                  <Typography>{file.name}</Typography>
                  <Button variant="outlined" color="secondary">Delete</Button>
                </Box>
              ))}
            </Box>
          )}
        </Box>
      </Container>
    </Box>
  );
};

export default Dashboard;
